import { SET_OBRA_SOCIAL, v } from "../actions/types";

export function setObraSocial(obraSocial) {
  //Set de la obraSocial que quiero editar
  return (dispatch) => {
    dispatch({
      type: SET_OBRA_SOCIAL,
      payload: obraSocial,
    });
  };
}
